// SPDX-License-Identifier: MIT
pragma solidity ^0.7.0;

contract XS2Factory {
    address public implementation;
    string public name;
    string public url;

    address public deployer;

    uint32 public totalContracts;
    mapping(uint32 => address) contracts;

    event ContractCreated(address newContractAddress);

    function initialize(
        address implementation_,
        string memory name_,
        string memory url_
    ) public {
        implementation = implementation_;
        name = name_;
        url = url_;
    }

    function deploy(bytes memory data) public returns (address) {
        bytes20 targetBytes = bytes20(implementation);
        address clone_address;
        // solium-disable-next-line security/no-inline-assembly
        assembly {
            let clone := mload(0x40)
            mstore(
                clone,
                0x3d602d80600a3d3981f3363d3d373d3d3d363d73000000000000000000000000
            )
            mstore(add(clone, 0x14), targetBytes)
            mstore(
                add(clone, 0x28),
                0x5af43d82803e903d91602b57fd5bf30000000000000000000000000000000000
            )
            clone_address := create(0, clone, 0x37)
        }

        contracts[totalContracts] = clone_address;
        totalContracts++;

        if (data.length > 0) {
            // solium-disable-next-line security/no-low-level-calls
            (bool success, bytes memory result) = clone_address.call(data);
            require(
                success && (result.length == 0 || abi.decode(result, (bool))),
                "XS2: Initialize failed."
            );
        }

        emit ContractCreated(clone_address);

        return clone_address;
    }
}
